import React from "react";
import { Row, Col, Container, Button } from "react-bootstrap";

const AttendanceList = () => {
  return (
    <>
      <Container className="text-center">
        <Row>
          <Col>
            <h3
              style={{
                fontWeight: "bold",
                color: "#535353",
                textAlign: "left",
                marginTop: "10px",
                marginBottom: "10px",
              }}
            >
              Attendance List
            </h3>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default AttendanceList;
